def charger(t: str):
    try:
        for i in range(n_stubs):
            with open(os.getcwd() + path + t + str(i + 1) + frmt) as f:
                stubs.append(f.read())
        print(stubs)
    except Exception as e:
        print(f"Fatal: {e}")
        print("Il y a eu une modification des fichiers tests. Veuillez y remedier.")
        exit(-1)


class Exo1Tests(unittest.TestCase):
    # Si ce test échoue, alors votre fonction charger_contenu n'est pas valide.
    def test_charger_contenu(self):
        try:
            for i in range(n_stubs):
                with open(os.getcwd() + path + 'r' + str(i + 1) + frmt, 'w') as r:
                    r.write(charger_contenu(os.getcwd() + path + 't' + str(i + 1) + frmt))

            for i in range(n_stubs):
                with open(os.getcwd() + path + 'r' + str(i + 1) + frmt, 'r') as r:
                    r_res = r.read()
                with open(os.getcwd() + path + 't' + str(i + 1) + frmt, 'r') as t:
                    t_res = t.read()
                self.assertEqual(r_res, t_res)
        except Exception as e:
            print(f"Fatal: {e}")
            print("Votre fonction charger_contenu n'est pas valide.")
            exit(-1)

